  ? '{{Quote|text=I am convinced that those societies (as the [[Native Americans in
    the United States|Indians]]) which live without government enjoy in their general
    mass an infinitely greater degree of happiness than those who live under the European
    governments. Among the former, public opinion is in the place of law, & restrains
    morals as powerfully as laws ever did anywhere. Among the latter, ''''''under
    pretence of governing they have divided their nations into two classes, wolves
    & sheep. I do not exaggerate. This is a true picture of Europe.'''''' Cherish
    therefore the spirit of our people, and keep alive their attention. Do not be
    too severe upon their errors, but reclaim them by enlightening them. If once they
    become inattentive to the public affairs, you & I, & Congress & Assemblies, judges
    & governors shall all become wolves. It seems to be the law of our general nature,
    in spite of individual exceptions; and ''''''experience declares that man is the
    only animal which devours his own kind, for I can apply no milder term to the
    governments of Europe, and to the general prey of the rich on the poor''''''.|sign=[[Thomas
    Jefferson]]|source=''''Letter to Edward Carrington - January 16, 1787''''}}'
