  ? "{{quote |\nThere are two ideas of government.There are those who believe that,\
    \ if you will only legislate to make the well-to-do prosperous, their prosperity\
    \ will leak through on those below.The Democratic idea, however, has been that\
    \ if you legislate to make the masses prosperous, their prosperity will find its\
    \ way up through every class which rests upon them.  You come to us and tell us\
    \ that the great cities are in favor of the gold standard; we reply that the great\
    \ cities rest upon our broad and fertile prairies.Burn down your cities and leave\
    \ our farms, and your cities will spring up again as if by magic; but destroy\
    \ our farms and the grass will grow in the streets of every city in the country.{{sfn|Bensel|pp=230\u2013\
    232}}\n}}"
