  ? "{{quote|If you think about it for a moment, slavery really makes no sense economically.\
    \  If you're a slave, then your incentive is to produce the bare minimum to avoid\
    \ a whipping.  But if you're a free laborer, you have an incentive to produce\
    \ more than the guy next to you, because you'll get paid more (or get promoted,\
    \ etc.).\n\nSo in a truly free market \u2013 even if it started out with some\
    \ people classified as the \"property\" of other people \u2013 there would be\
    \ tremendous incentives for the slaves to buy their freedom from their masters.\
    \  Don't get me wrong, that would be horribly unfair and they shouldn't have to\
    \ do that in the first place, but nonetheless widespread slavery wouldn't persist\
    \ if the rest of the economy were a free market.\n\nYet that's not what happened\
    \ historically.  Indeed, there were all sorts of government interventions that\
    \ propped up the \"peculiar institution.\"  Just a few examples: (1) mandatory\
    \ slave patrols, in which the local governments forced non-slave owners to defray\
    \ the costs of the institution, (2) laws against educating slaves, and (3) laws\
    \ curtailing manumission, i.e. the practice of freeing one's slaves (often in\
    \ one's will).\n\nSo as these two examples demonstrate, the popular historical\
    \ accounts of the antebellum South and the 1930s get things exactly backwards.\
    \ It was government intervention in voluntary, private affairs that propped up\
    \ slavery and led to the Great Depression.}}"
  : ''
  ? '{{quote|It has been thought that circumcision perfects what is defective congenitally.
    This gave the possibility to everyone to raise an objection and to say: How can
    natural things be defective so that they need to be perfected from outside, all
    the more because we know how useful the foreskin is for that member? In fact this
    commandment has not been prescribed with a view to perfecting what is defective
    congenitally, but to perfecting what is defective morally. The bodily pain caused
    to that member is the real purpose of circumcision. None of the activities necessary
    for the preservation of the individual is harmed thereby, nor is procreation rendered
    impossible, but violent concupiscence and lust that goes beyond what is needed
    are diminished. The fact that circumcision weakens the faculty of sexual excitement
    and sometimes perhaps diminishes the pleasure is indubitable. For if at birth
    this member has been made to bleed and has had its covering taken away from it,
    it must indubitably be weakened. The Sages, may their memory be blessed, have
    explicitly stated: It is hard for a woman with whom an uncircumcised man has had
    sexual intercourse to separate from him. In my opinion this is the strongest of
    the reasons for circumcision.

    | author = [[Maimonides]]

    | source = [[The Guide to the Perplexed|''''The Guide to the Perplexed'''' (1190)]]

    }}'
  : ''
